import React, { Component } from 'react';
import Bg from './bg1.png';
class App extends Component {
  render() {
    return (
      <div style={styles.wrapper}>
        <div style={styles.parent}>

        </div>
      </div>
    )
  }

}

let h = window.innerHeight;

const styles = {
  wrapper: {
    display: "flex",
    backgroundImage: `url(${Bg})`,

    backgrondSize: "cover",
    height: "100%",
  },
  parent: {
    height: h,
    width: "100%",
    display: "flex",
  }
}
export default App;
